static U32 precis_xprop_lookup(U32 cp)
{
    if (cp == 0x0E0001 || (0x0E0020 <= cp && cp <= 0x0E007F)
	|| (0x0E0100 <= cp && cp <= 0x0E01EF))
	return JT_T;
    else if (0x040000 <= cp)
	return 0;

    return precis_xprop_array[precis_xprop_index[cp >> XPROP_BLKWIDTH] +
			      (cp & ((1 << XPROP_BLKWIDTH) - 1))
	];
}

